import "./Sidebar.css";

export default function Sidebar() {
  return (
    <aside className="sidebar">
      <h2>Salon</h2>
      <nav>
        <a className="active">Dashboard</a>
        <a>My Store</a>
        <a>Inventory</a>
        <a>Reports</a>
        <a>Customers</a>
        <a>Expenses</a>
      </nav>
    </aside>
  );
}
